import React from "react";
import { Text, StyleSheet, View, TextBase } from "react-native";

const BoxScreen = () => {
  return (
    <View style={estilos.viewStyle}>
      <Text style={estilos.textStyle}>box page</Text>
      <Text style={estilos.textStyle}>box segundo</Text>
      <Text style={estilos.textStyle}>box tercero</Text>
    </View>
  );
};

const estilos = StyleSheet.create({
  viewStyle: {
    borderWidth: 1,
    borderColor: "black",
    alignItems: "center",
    justifyContent: "space-around",
  },

  textStyle: {
    borderWidth: 1,
    borderColor: "red",
  },
});

export default BoxScreen;
